import Cookies from 'js-cookie'
import {Redirect, Link} from 'react-router-dom'

import Header from '../Header'

import './index.css'

const Home = () => {
  const jwtToken = Cookies.get('jwt_token')
  if (jwtToken === undefined) {
    return <Redirect to="/login" />
  }

  return (
    <>
      <Header />
      <div className="home-container">
        <div className="home-content">
          <h1 className="home-heading">
            Electrifying Rides for a Greener Future: Experience the Power of EV
            Cabs!
          </h1>
          <img
            src="data:image/jpeg;base64,"
            alt="clothes that get you noticed"
            className="home-mobile-img"
          />
          <p className="home-description">
            The Cab System app is a ride-sharing service that allows passengers
            to request a ride from drivers in the area. The app handles all
            aspects of the ride, from booking to payment. Here is a high-level
            architecture of the Cab system
          </p>
          <Link to="/products">
            <button type="button" className="shop-now-button">
              Get a ride
            </button>
          </Link>
        </div>
        <img
          src="data:image/jpeg;base64,"
          alt="clothes that get you noticed"
          className="home-desktop-img"
        />
      </div>
    </>
  )
}

export default Home
